/*Given a string s and a non-empty string p, find all the start indices of p's anagrams in s.

Strings consists of lowercase English letters only and the length of both strings s and p will not be larger than 20,100.

The order of output does not matter.

Example 1:

Input:
s: "cbaebabacd" p: "abc"

Output:
[0, 6]

Explanation:
The substring with start index = 0 is "cba", which is an anagram of "abc".
The substring with start index = 6 is "bac", which is an anagram of "abc".
Example 2:

Input:
s: "abab" p: "ab"

Output:
[0, 1, 2]

Explanation:
The substring with start index = 0 is "ab", which is an anagram of "ab".
The substring with start index = 1 is "ba", which is an anagram of "ab".
The substring with start index = 2 is "ab", which is an anagram of "ab".*/

#include <stdio.h>
#include <stdlib.h>
#include <string.h>
#include <math.h>
#include <stdbool.h>
#include <limits.h>

int cmp(const void* a, const void* b){
	return *(char *)a-*(char*)b;
}

int* findAnagrams(char* s, char* p, int* returnSize) {
	int slen = strlen(s), plen = strlen(p), tmp = 0, tmp1 = 0;
	if(slen<plen) return NULL;
	int *ret = (int *)calloc(0, sizeof(int));
	int saver[26]={0};
	int saver1[26]={0};
	for (int k = 0; k < plen; k++) {
		saver[p[k]-'a']++;
		saver1[s[k]-'a']++;
		tmp ^= s[k];
		tmp1 ^= p[k];
	}

	for (int i = 0; i <= slen - plen; i++) {
		if (i - 1 >= 0) {
			tmp = tmp ^ s[i - 1] ^ s[i - 1 + plen];
			saver1[s[i - 1]-'a']--;
			saver1[s[i - 1 + plen]-'a']++;
		}
		if (tmp == tmp1) {
			if (memcmp(saver,saver1,26*sizeof(int))==0) {
				ret = (int *)realloc(ret, (*returnSize + 1) * sizeof(int));
				ret[*returnSize] = i;
				*returnSize += 1;
			}
		}
	}
	return ret;
}

int main(int argc, char const *argv[])
{
	char s[] = "";
    char p[] = "";
	int returnSize = 0;
	int *ret = findAnagrams(s, p, &returnSize);
	for (int i = 0; i < returnSize; i++) {
		printf("%d\n", ret[i]);
	}
	return 0;
}